import logo from './logo.svg';
import './App.css';
import {Routes,Route} from 'react-router-dom'
import Home from './component/Home';
import About from './component/About';
import Service from './component/Service';
import Navbar from './component/Navbar';
import Nomatch from './component/Nomatch';
import Product from './component/Product';
import New from './component/New';
import Best from './component/Best';
import Order from './component/Order';
import User from './component/User';
import UserDet from './component/UserDet';
import Profile from './component/Profile';
import Login from './component/Login';
import Signup from './component/signup';
import RequiredAuth from './component/RequiredAuth';
import Loginsuccessfully from './component/Loginsuccessfully';
import Signupsuccessfully from './component/Signupsuccessfully';
import {AuthProvider} from './component/auth';
function App() {
  return (
    <div className="App">
     <AuthProvider>

        <Navbar/>

          <Routes>

            <Route path='/' element={<RequiredAuth><Home/></RequiredAuth>}></Route> 
            <Route path='/about' element={<RequiredAuth><About/></RequiredAuth>}></Route>

            <Route path='/service' element={<RequiredAuth><Service/></RequiredAuth>}/>

            <Route path='*' element={<Nomatch/>}/>


            <Route path="/product" element={<RequiredAuth><Product/></RequiredAuth>}> 
            <Route path="new" element={<New/>}/>

            <Route path="best" element={<Best/>}/>

            <Route index element={<New/>}/>
             </Route>

            <Route path="/order" element={<Order/>}/>

            <Route path="/user" element={<User/>}>

            <Route path=":userid" element={<UserDet/>}/>

            </Route>

            <Route path="/profile" element={<RequiredAuth><Profile/></RequiredAuth>}/>
            <Route path="/login" element={<Login/>}/>
            <Route path="/signup" element={<Signup/>}/>
            <Route path="/Loginsuccessfully" element={<Loginsuccessfully/>}/>
            <Route path="/Signupsuccessfully" element={<Signupsuccessfully/>}/>

          </Routes>

      </AuthProvider>
    </div>
  );
}

export default App;
